import React, { Component } from 'react';
import '../website.css';
import CodeBase from '../images/codebase_icon.png';
import warren from '../images/warren.JPG';



class Experiences extends Component {

    constructor(props) {
        super(props);
        this.routeToExp = this.routeToExp.bind(this);
    }
    routeToHome() {
        const path = '/';
        this.props.history.push(path);

    }

    routeToExp() {
        const path = '/experiences';
        this.props.history.push(path);

    }

    routeToProj() {
        const path = '/projects';
        this.props.history.push(path);

    }

    render() {
        var experiences = [{ date: "Feb", img: CodeBase, desc: "waefrgdb aefgr sew aefgea w  waef gr arwe w er ertgr ew e  er3 4 g  rs g e ewr tg wr fae" },
        { date: "Feb", img: CodeBase, desc: "waefrgdb aefgr sew wefartd arwe w er ertgr ew e  er3 4 g  rs g e ewr tg wr fae" }
        ];

        console.log("rendering exp");
        return (
            <div className="Experiences">
                <div className="header">
                    MY EXPERIENCES
                </div>
                <div className="EP-container">
                    <img className="EP-image" src={warren} />
                    <div className="EP-overlay">
                        <p onClick={() => this.routeToHome()} className="text">HOME</p>
                        <p onClick={() => this.routeToExp()} className="text">EXPERIENCES</p>
                        <p onClick={() => this.routeToProj()} className="text">PROJECTS</p>

                    </div>
                </div>
                <div className="exp-content">
                    <div className="exp-images">
                        {experiences.map((exp) => (
                            <div className="exp">
                                <img src={exp.img} className="exp-img" />
                            </div>
                        )
                        )}
                    </div>

                    <div className="exp-descriptions">
                        {experiences.map((exp) => (
                            <div className="exp">
                                <p className="exp-date">{exp.date} </p>

                                <p className="exp-desc">{exp.desc} </p>
                            </div>
                        )
                        )}
                    </div>
                </div>

            </div>
        );
    }
}

export default Experiences;
